import React from 'react';

export default function ContentCard({ item }) {
  const isPaid = !!item.price;
  return (
    <div className="card">
      <div className="card-img">
        <img src={item.previewImage || item.image || 'https://via.placeholder.com/400x300?text=Image'} alt={item.title} />
      </div>
      <div className="card-body">
        <div className="card-user">{item.userName || 'Unknown'}</div>
        <div className="card-title">{item.title || 'Untitled'}</div>
        <div className="card-pricing">{isPaid ? `Paid — ₹${item.price}` : (item.pricing || 'Free/View')}</div>
      </div>
    </div>
  );
}
